import merch from "../views/MerchPage.module.css";
import {ClickDetailButton} from "./ClickButton";
import React from "react";

function Tiles(props) {
    return(
        <div className={merch.tile}>
            <img className={merch.pic} src={props.name} alt={props.description}/>
            <p>{props.description}</p>
            <p>{props.price}</p>
            <ClickDetailButton path='tshirt1' name='DETAILS'/>
        </div>
    )
}

export default Tiles;
